            <div id=""holder"" class=""row content"">

                <!--Paper-->
                <div id=""quote"" class=""col-lg-8 select--highlight--active"" data-aos=""fade-up"" data-aos-delay=""150"">
                    <p><span style=""color:gray;"">Josh, I corrected a few scattered English errors, that would have cost you grade points. Like always you always have soul in your writing. Good teachers love that because it lets them give good writers extra scores. The few changes I made aren’t all that important but they are worth making for the extra grade you’ll get because of them.&nbsp; Love you, Josh.&nbsp; Grandpa</span></p><p><br data-cke-filler=""true""></p><p>Studying computer science has not been an easy path. However, there are few things as rewarding. The reward of learning something complex, that few people in the world understand, has been a great boost to my mental ability to push through tough times. Knowing if time is spent studying and learning, there are very few goal");
            WriteLiteral(@"s that are not achievable in life. &nbsp;Without the disciplines I’ve learned in computer science, I’m not sure I would understand the concept that I was the only</p><p>thing keeping me from becoming better.&nbsp;</p><p><strong>Why Graduate School?</strong></p><p>There are several reasons for my desire to attend graduate school. The main reason, as rudimentary as it may be, I love computer science. This enjoyment gets me up every day and motivates me to learn something new. Whether it be, studying the newest version of Twitters API or watching YouTube videos learning more about software architecture. Computer Science is a part of me, and I could not be happier having the opportunity to study such a complex topic.&nbsp;</p><p>Apart from my love for Computer Science, I do enjoy teaching and helping people learn more about the topic.&nbsp;One of the best times I have had was helping Dr. Roach do lab check offs as a lab assistant.&nbsp; During the labs, I helped walk students through coding complications, helping");
            WriteLiteral(@" them fix issues they were having problems with. This was super fun and opened me up to the idea that I could one day manage a team of developers or be a lecturer.&nbsp;</p><p>East Tennessee State University has become home for me. I enjoy being on campus, learning from my professors, and solving problems with my classmates. The atmosphere for learning on campus is awesome. If it was not, I probably would not be as interested in graduate school. Recently, ETSU tweeted an article about how they are a top institution for helping students with learning disabilities. I can attest to this. ETSU has made it possible for me, a person with dyslexia, to finish a degree. Therefore, I would like to continue my extended education on campus, because of the wonderful professors and their willingness to help.&nbsp;</p><p><strong>Career Goals</strong></p><p>As a computer science major, I have a few career goals. Some of my goals are simple and some more complex. A good summation for said goal would be, I want a steady job wi");
            WriteLiteral(@"th a large corporation where I can learn to work with a team. While<a href=""#_msocom_1"">[JT1]</a> &nbsp;at said job, have side projects that generate revenue from something I have built with my software engineering skills. It has also crossed my mind that I could become a lecturer. However, I am thinking that the teaching job should come later in my career, but if the opportunity presents itself, I would evaluate the situation for consideration. &nbsp;</p><p>If a path for corporate work is opened, a graduate degree will help me become better equipped and well versed in the computer science field to help organizations solve their problems via Information Technology. With this knowledge, I can become well suited to manage a team of developers, helping them solve their problems.&nbsp;<a href=""#_msocom_2"">[JT2]</a>&nbsp;</p><p>Hopefully, my work experience at a good corporation combined with a graduate degree will give me the experience to one day start a tech company. I find it fascinating to build solutions for");
            WriteLiteral(@" problems people did not know they had. I’ve always been the builder type, taking a mental concept and making it into a tangible product has an overwhelming appeal. Thus, my love for computer science</p><p>Simply put, I want to further my education because of my love for computer science and ETSU. Learning will always be a part of my profession but getting the opportunity to extend my education as a first-generation graduate student would be a great honor.&nbsp;Thank you for the consideration to allow me an opportunity to continue my education, studying my passion.&nbsp;</p><p><br data-cke-filler=""true""></p><p><br data-cke-filler=""true""></p><p>&nbsp;<a href=""#_msoanchor_1"">[JT1]</a>Shorten area. Combine the corporate, tech, and teaching.</p><p><br data-cke-filler=""true""></p><p>&nbsp;<a href=""#_msoanchor_2"">[JT2]</a>Add this to the paragraph above about the corporate section.</p><p><br data-cke-filler=""true""></p>
